                    // Total over all pages
                    total = api
                        .column(currentPosition)
                        .data()
                        .reduce(function(a, b) {
                            return intVal(a) + intVal(b);
                        }, 0);

                    // Total over this page
                    pageTotal = api
                        .column(currentPosition, {
                            page: 'current'
                        })
                        .data()
                        .reduce(function(a, b) {
                            return intVal(a) + intVal(b);
                        }, 0);

                    var formattedTotal = "Rp. " + formatNumber(pageTotal);

                    // Update footer
                    $(api.column(currentPosition).footer()).html(
                        formattedTotal
                    );
                    // $( api.column(0).footer() ).attr('rowspan', 5);
